import time
def retry(count, exceptions=Exception, delay=0):
    """
    This wrapper is used for retry the function(f) if has error,
    will continue for count times

    :param int count: maximize retry count, totally execution time will be ``count+1``
    :param tuple exceptions: exceptions will trigger the retry, others to stop
                             the retry, default to all exceptions
    :param int delay: amount time to delay between each retry execution
    """
    if isinstance(exceptions, list):
        exceptions = tuple(exceptions)

    def _f(f):
        def _retry(*args, **kwargs):
            for _ in range(count+1):
                try:
                    ret = f(*args, **kwargs)
                    return ret
                except exceptions as e:
                    if delay > 0:
                        time.sleep(delay)

                    _e = e
            raise _e
        return _retry

    return _f

@retry(3)
def hello():
    return 1/0

